import React from "react";
import "../App.css";
import "../css/Skills.css";
import { makeStyles, createStyles, Theme } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";

const skillsStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {
      flexGrow: 1
    },
    icon: {
      padding: theme.spacing(10),
      textAlign: "center",
      color: theme.palette.text.secondary
    }
  })
);

function Skills() {
  const skillsStyle = skillsStyles();

  return (
    <div id="skills">
      <div>
        <p className="menu-name">SKILLS</p>
      </div>
      <Grid container spacing={3}>
        <Grid item xs={12} sm={4} md={4}>
          <Paper className={skillsStyle.keyword}>끈기</Paper>
        </Grid>
        <Grid item xs={12} sm={4} md={4}>
          <Paper className={skillsStyle.keyword}>도전</Paper>
        </Grid>
        <Grid item xs={12} sm={4} md={4}>
          <Paper className={skillsStyle.keyword}>협력</Paper>
        </Grid>
        <Grid item xs={12} md={6}>
          <Paper className={skillsStyle.profile}>
            <img src="/img/main.jpg" alt="프로필 사진" id="profile-img" />
            <div>
              <p className="text-bold text-1H">프로필</p>
              <p>석현승</p>
              <p>1991.12.02</p>
              <p></p>
            </div>
          </Paper>
        </Grid>
      </Grid>
    </div>
  );
}

export default Skills;
